//------------ Timer Device --------------------------------------------------

volatile int *timer_ptr = (int *)0xFF202000;
int lower = 0xE100;
int upper = 0x05F5;

//------------ Main Function --------------------------------------------------

int main(void) {
  //----- Initialize video device

  /* set front pixel buffer to Buffer 1 */
  *(pixel_ctrl_ptr + 1) =
      (int)&Buffer1;  // first store the address in the back buffer
  /* now, swap the front/back buffers, to set the front buffer location */
  wait_for_vsync();
  /* initialize a pointer to the pixel buffer, used by drawing functions */
  pixel_buffer_start = *pixel_ctrl_ptr;
  clear_screen();  // pixel_buffer_start points to the pixel buffer

  /* set back pixel buffer to Buffer 2 */
  *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // we draw on the back buffer
  clear_screen();  // pixel_buffer_start points to the pixel buffer


  bgBufferX = 320;

  //----- Initialize player

  dino.yPosition = dinoIdleHeight;
  dino.jumping = false;
  dino.ducking = false;
  dino.rising = false;
  
  //----- Initialize timer
  *(timer_ptr) = 0;
  *(timer_ptr + 2) = lower;
  *(timer_ptr + 3) = upper;	 
  *(timer_ptr + 1) = 0b0110;
	
  //----- Main Loop

  while (1) {  		
    if ((*(timer_ptr) & 0x01) == 0x01) {
	    *(timer_ptr) = 0;
	    score++;
		smallScore++;
    }
    
    if (gameStarted == 0) {
      clear_screen();
      drawStartScreen();
      handleBtn();
      handleKeys();
      score = 0;
    }
	  
    if (gameOver == 0 && gameStarted == 1) {
	  *(timer_ptr + 1) = 0b0110;
      // Wipe buffer
      clear_screen();


      drawScore();


      // Detect inputs
      handleBtn();
      handleKeys();

      // Update player position
      updatePlayerPosition();

      // Draw elements
      drawObstacle();
	  drawSky();
      drawGround();
      drawPlayer();

      // check for collision
      checkCollision();

      // increment score
      createObstacle();
		
	//audio_playback_mono(jumpSound, jumpSamplesN);


    }

	if (gameOver == 1 & gameStarted == 1 & lastDraw == 0) {
	  clear_screen();

      drawScore();
	  obstacleCheck();
		
      // Detect inputs
      handleBtn();
      handleKeys();

      // Update player position
      updatePlayerPosition();

      // Draw elements
      drawObstacle();
      drawSky();
      drawGround();
      drawPlayer();
		
	  lastDraw = 1;
	}
	  
    if (gameOver == 1 & gameStarted == 1 & lastDraw == 1) {
	    *(timer_ptr + 1) = 0b1000;
      drawEndScreen();
      turnDeath++;
      if(turnDeath == 1){
        //audio_playback_mono(death, deathSamplesN);
		  sn = 0;
      }

      handleBtn();
	    handleKeys();

      if(score >= highestScore){
        highestScore = score;
      }

      score = 0;
	    smallScore = 0;
    }
			
    wait_for_vsync();  // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer
  }
}

//--------- Video Functions ---------------------------------------

void createObstacle() {
	if (score > 10) {
		if (((score < 25) && (smallScore % 5 == 4)) || (score == 10)) {
			for (int i = 0; i < 1; i++) {
				if (cacStatus[i] == 0) {
					cacStatus[i] = 1;
					cacOrBird[i] = 1;
					xPosi[i] = 293;
					smallScore = 0;
					break;
				}
			}
		}
		
		else if ((score >= 25) && (smallScore % 4 == 3)) {
			for (int i = 0; i < 3; i++) {
				if (cacStatus[i] == 0) {
					cacStatus[i] = 1;
					cacOrBird[i] = rand()%2 + 1;
					xPosi[i] = 293;
					smallScore = 0;
					break;
				}
			}
		}
	}
}

void drawObstacle() {
  volatile short int *one_pixel_address;
  int index = 0;
	
  for (int i = 0; i < 3; i++) {
    if (cacStatus[i] == 1 && cacOrBird[i] == 1) {
      for (int y = GROUND_YPOSITION-CACTUS_HEIGHT; y < GROUND_YPOSITION; y++) {
        for (int x = xPosi[i]; x < xPosi[i]+CACTUS_WIDTH; x++) {
          one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
          *one_pixel_address = cactus[index];
          index++;
        }
      }
	  index = 0;
    }
    
    else if (cacStatus[i] == 1 && cacOrBird[i] == 2) {
      for (int y = GROUND_YPOSITION-BIRD_DRAW_HEIGHT-BIRD_HEIGHT; y < GROUND_YPOSITION-BIRD_DRAW_HEIGHT; y++) {
        for (int x = xPosi[i]; x < xPosi[i]+BIRD_WIDTH; x++) {
          one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
          //*one_pixel_address = cactus[index];
          *one_pixel_address = bird[index];
          index++;
        }
      }
	  index = 0;
    }
	index = 0;
  }
  obstacleCheck();
}

void obstacleCheck() {
	for (int i = 0; i < 3; i++) {
		if (gameOver == 1 & lastDraw == 0) {
			xPosi[i] = xPosi[i] - 10;
			continue;
		}
		
		if (xPosi[i] <= 0) {
			cacStatus[i] = 0;
			cacOrBird[i] = 0;
		}
		else {
			xPosi[i] = xPosi[i] - 10;
			//2
		}
	}
}

