void wait_for_vsync() {
  *pixel_ctrl_ptr = 1;  // request swap
  // wait for current displayed frame to finish
  while ((*(pixel_ctrl_ptr + 3) & 1) != 0);
}

void drawPlayer() {
  volatile short int *one_pixel_address;

  int index = 0;

  if(!dino.jumping && !dino.ducking){
    for (int y = dino.yPosition; y < dino.yPosition + DINOIDLE_HEIGHT; y++) {
      for (int x = PLAYER_XPOSITION; x < PLAYER_XPOSITION + DINOIDLE_WIDTH;
           x++) {
        one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
        if(frameCounter == 2){
          leftDinoSprite = !leftDinoSprite;
          frameCounter = 0;
        }
        if(leftDinoSprite){
          *one_pixel_address = dinoLLeg[index];
        }else{
          *one_pixel_address = dinoRLeg[index];
        }
        
        index++;
      }
    }
    frameCounter++;
  }else if (dino.jumping) {
    for (int y = dino.yPosition; y < dino.yPosition + DINOIDLE_HEIGHT; y++) {
      for (int x = PLAYER_XPOSITION; x < PLAYER_XPOSITION + DINOIDLE_WIDTH;
           x++) {
        one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
        *one_pixel_address = dinoIdle[index];
        index++;
      }
    }
  } else if(dino.ducking) {
    for (int y = dino.yPosition; y < dino.yPosition + DINODUCKING_HEIGHT; y++) {
      for (int x = PLAYER_XPOSITION; x < PLAYER_XPOSITION + DINODUCKING_WIDTH; x++) {
		one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
		  
		 if(frameCounter == 2){
          leftDinoSprite = !leftDinoSprite;
          frameCounter = 0;
        }
        if(leftDinoSprite){
          *one_pixel_address = dinoDucking[index];
        }else{
          *one_pixel_address = dinoDucking2[index];
        }
        
        index++;
      }
    }
	  frameCounter++;
  }
}

void drawGround() {
  volatile short int *one_pixel_address;
	
  if(bgBufferX < 0){
    bgBufferX = 320;
  }

  for (int x = 0; x < 320; x++) {
    one_pixel_address =
        pixel_buffer_start + (GROUND_YPOSITION << 10) + (x << 1);
    *one_pixel_address = 0x0;
  }

  int index = 0;

  for (int y = GROUND_YPOSITION+1; y < DIRT_HEIGHT + GROUND_YPOSITION+1; y++) {
    for (int x = bgBufferX; x < 320; x++) {
      one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
      *one_pixel_address = dirt[index];
      index++;
    }
    index+=bgBufferX;
  }

  index = 320-bgBufferX;
  for (int y = GROUND_YPOSITION+1; y < DIRT_HEIGHT + GROUND_YPOSITION+1; y++) {
     for (int x = 0; x < bgBufferX; x++) {
       one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
       *one_pixel_address = dirt[index];
       index++;
     }
     index+=(320-bgBufferX);
  }

  bgBufferX-=5;

}

